               NULL,","   lname          varchar(30)       NOT NULL,","","   job_id         smallint          NOT NULL","","         DEFAULT 1","","         REFERENCES jobs(job_id),","","   job_lvl        tinyint","","         DEFAULT 10,","","   pub_id         char(4)           NOT NULL","","         DEFAULT ('9952')","","         REFERENCES publishers(pub_id),","","   hire_date      datetime          NOT NULL","","         DEFAULT (getdate())",")","","GO","","raiserror('Now at the create trigger section ...',0,1)","","GO","","CREATE TRIGGER employee_insupd","ON employee","FOR insert, UPDATE","AS","--Get the range of level for this job type from the jobs table.","declare @min_lvl tinyint,","   @max_lvl tinyint,","   @emp_lvl tinyint,","   @job_id smallint","select @min_lvl = min_lvl,","   @max_lvl = max_lvl,","   @emp_lvl = i.job_lvl,","   @job_id = i.job_id","from employee e, jobs j, inserted i","where e.emp_id = i.emp_id AND i.job_id = j.job_id","IF (@job_id = 1) and (@emp_lvl \u003c\u003e 10)","begin","   raiserror ('Job id 1 expects the default level of 10.',16,1)","   ROLLBACK TRANSACTION","end","ELSE","IF NOT (@emp_lvl BETWEEN @min_lvl AND @max_lvl)","begin","   raiserror ('The level for job_id:%d should be between %d and %d.',","      16, 1, @job_id, @min_lvl, @max_lvl)","   ROLLBACK TRANSACTION","end","","GO","","raiserror('Now at the inserts to authors ....',0,1)","","GO","","insert authors","   values('409-56-7008', 'Bennet', 'Abraham', '415 658-9932',","   '6223 Bateman St.', 'Berkeley', 'CA', '94705', 1)","insert authors","   values('213-46-8915', 'Green', 'Marjorie', '415 986-7020',","   '309 63rd St. #411', 'Oakland', 'CA', '94618', 1)","insert authors","   values('238-95-7766', 'Carson', 'Cheryl', '415 548-7723',","   '589 Darwin Ln.', 'Berkeley', 'CA', '94705', 1)","insert authors","   values('998-72-3567', 'Ringer', 'Albert', '801 826-0752',","   '67 Seventh Av.', 'Salt Lake City', 'UT', '84152', 1)","insert authors","   values('899-46-2035', 'Ring